--
-- Name: gendailycallsummary(date); Type: FUNCTION; Schema: pnd; Owner: pnd
--

CREATE FUNCTION gendailycallsummary(rpt_date date) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    r "mregion";
    tjob integer;
    tprice numeric(20,4);
    tinch  numeric(20,4);
    amtinMYR numeric(20,4);
    amtinUSD numeric(20,4);
BEGIN
    -- delete from the tmp table
    delete from tmp_dailycalldata;
    -- delete from the rpt date for that day
    delete from rpt_dailycallsummary where rpt_completiondate = rpt_date;

    -- select the data from mjobsheet for that day

    -- count and insert into temp table

    -- pivot the table and insert into rpt_table
    FOR r IN 
	select * from mregion         
    LOOP
        SELECT count(*) as totaljob,  coalesce(sum(js_finalprice),0) as totalprice, coalesce(sum(js_totalinch),0) as totalinch,
        sum( usdtomyr(js_finalprice,js_rate,js_currency) ) as amtinMYR,
        sum( myrtousd(js_finalprice,js_rate,js_currency) ) as amtinUSD
        into tjob,tprice,tinch,amtinMYR,amtinUSD
        FROM mjobsheet 
        join fcorg on js_orgid = org_id
        join mregion on org_region = rg_code
        where js_completiondate > rpt_date and js_completiondate < rpt_date + interval '1 day'
        and js_status = 'COMPLETED'
        and org_external = 'Y'
        and org_region = r.rg_code;

        values(rpt_date,r.rg_code,tjob,tprice,tinch,amtinMYR,amtinUSD);
        
        RAISE NOTICE 'i want to print region code = % total job % totalprice % totalinch %', r.rg_code,tjob,tprice,tinch;
    END LOOP;
  
    rpt_astotaljob,rpt_astotalprice,rpt_astotalinch,
    rpt_eutotaljob,rpt_eutotalprice,rpt_eutotalinch,
    rpt_lctotaljob,rpt_lctotalprice,rpt_lctotalinch,
    rpt_totalpriceinmyr,rpt_totalpriceinusd)
    select totaljob.completiondate, 
	totaljob.astotaljob, totalprice.astotalprice, totalinch.astotalinch,
	totaljob.eutotaljob, totalprice.eutotalprice, totalinch.eutotalinch,
	totaljob.lctotaljob, totalprice.lctotalprice, totalinch.lctotalinch,
	totalinmyr.astotalpriceinmyr+totalinmyr.eutotalpriceinmyr+totalinmyr.lctotalpriceinmyr as totalpriceinmyr,
	totalinusd.astotalpriceinusd+totalinusd.eutotalpriceinusd+totalinusd.lctotalpriceinusd as totalpriceinusd
	from crosstab ('
	select tmp_completiondate,tmp_region,tmp_totaljob
	from tmp_dailycalldata 
	order by 1,2')
	as totaljob(completiondate date, astotaljob int,eutotaljob int, lctotaljob int)
	full outer join 
	crosstab ('
	select tmp_completiondate,tmp_region,tmp_totalprice
	from tmp_dailycalldata 
	order by 1,2')
	as totalprice(completiondate date, astotalprice numeric,eutotalprice numeric, lctotalprice numeric) on totaljob.completiondate = totalprice.completiondate
	full outer join 
	crosstab ('
	select tmp_completiondate,tmp_region,tmp_totalinch
	from tmp_dailycalldata 
	order by 1,2')
	as totalinch(completiondate date, astotalinch numeric,eutotalinch numeric, lctotalinch numeric) on totalprice.completiondate = totalinch.completiondate
	full outer join 
	crosstab ('
	select tmp_completiondate,tmp_region,tmp_amtinmyr
	from tmp_dailycalldata 
	order by 1,2')
	as totalinmyr(completiondate date, astotalpriceinmyr numeric,eutotalpriceinmyr numeric, lctotalpriceinmyr numeric) on totalinch.completiondate = totalinmyr.completiondate
	full outer join 
	crosstab ('
	select tmp_completiondate,tmp_region,tmp_amtinusd
	from tmp_dailycalldata 
	order by 1,2')
	as totalinusd(completiondate date, astotalpriceinusd numeric,eutotalpriceinusd numeric, lctotalpriceinusd numeric) on totalinmyr.completiondate = totalinusd.completiondate;
    
    RETURN;
END
$$;


ALTER FUNCTION pnd.gendailycallsummary(rpt_date date) OWNER TO pnd;

--
-- Name: generatedata(); Type: FUNCTION; Schema: pnd; Owner: pnd
--

CREATE FUNCTION generatedata() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    currenttime timestamp;
    jobid integer;
    caseid integer;
BEGIN

delete from mjobsheet;

delete from fcpmcase;

delete from fcpmcaseflow;
-- get current time
select now() into currenttime;

-- generate certain number of record
FOR i IN 2..10 LOOP

if i = 2 then

js_title,js_model,js_description,
js_color_1,js_color_2,js_color_3,js_color_4,
js_angle_1,js_angle_2,js_angle_3,js_angle_4,
js_bleeding,js_primcat)
values(i,i-1,  currenttime - interval '4 hour','QC',currenttime - interval '3 hour','artist1',
'Title '||i,'Model '||i,'Description '||i,
get_random_integer(1,100),get_random_integer(1,100),get_random_integer(1,100),get_random_integer(1,100),
get_random_integer(1,359),get_random_integer(1,359),get_random_integer(1,359),get_random_integer(1,359),
