--

CREATE FUNCTION usdtomyr(numeric, numeric, character varying) RETURNS numeric
    LANGUAGE plpgsql STRICT
    AS $_$

DECLARE

    p_amount ALIAS FOR $1;

    p_rate ALIAS FOR $2;

    p_currencycode ALIAS for $3;

BEGIN

    if p_currencycode != 'MYR' then
       return round( (p_amount * p_rate), 2);
    else
       return round( p_amount, 2);
    end if;
END;

$_$;


